  <h1>
   G1631 ἐκφύω
  </h1>
  <h2>
   ekphýō
  </h2>
  <p>
   <em>
    (ek-foo'-o | ek-FOO-oh | ake-FYOO-oh)
   </em>
  </p>
  <h3>
   Definition
  </h3>
  <p>
   from [G1537] and [G5453]; to sprout up; put forth.
  </p>
  <ul>
   <li>
    to generate or produce from
   </li>
   <li>
    to cause to grow out
   </li>
  </ul>

   See also
  </h3>
  <p>
   [G1537], [G5453]
